import React from 'react';
import DefaultImage from '../../assets/images/logo-db.png';
const Card = () => {
    return (
        <div className="rounded-[15px] overflow-hidden">
            {/* card image */}
            <div class="relative">
                <a href="" class="relative h-[220px] block">
                    <img src={DefaultImage} alt="car image" loading="lazy" className/>
                </a>
            </div>
            {/* card content */}
        </div>
    )
}

export default Card
